import React from 'react';
import PropTypes from 'prop-types';
import SpielKarte from './spielkarte';

const getSpiele = (spiele) => {
    return (
        <div className="card-deck">
          {
            // {
            //     console.log('Hier!')}
            //     {setTimeout(function(){
            //       console.log("THIS IS");
            //     }, 10000)}
            //     {console.log("DOG")}
          }
          {spiele.map(spiele => <SpielKarte key={spiele.autor} spiele={spiele} />)}
        </div>
    );
};

const Spielliste = (props) => (
    <div>
        {console.log('Spielliste: before getSpiele')}
        {getSpiele(props.spiele)}
        {console.log('Spielliste: after getSpiele')}
    </div>
);

Spielliste.defaultProps = {
    spiele: []
};

Spielliste.propTypes = {
    spiele: PropTypes.array
};

export default Spielliste;
